const AdminDashbord = () => {
  const dispatch = useDispatch();
  const { productList, loading } = useSelector((state) => state.product);
  useEffect(() => {
    dispatch(getProducts());
  }, [dispatch]);
  return (
    <div>
        <>
          <ProduuctModal />
      {loading && <p>loading..</p>}
          <h6>{el.desc}</h6>
          <img src={el.image} alt="product img" />
          <h6>{el.price}</h6>
        </>
      ))}
    </div>
  );
};

export default AdminDashbord;
